import React from 'react'
import CancelIcon from '@material-ui/icons/Cancel';

function UploadLoveFramesData(props) {
    return (props.dataTrigger)?(
        <div className='popup'>
            <div className='popup-inner'>
                <CancelIcon 
                    className="close-btn" 
                    onClick={()=>{
                        props.setDataTrigger(false)
                        console.log(props.dataTrigger);
                    }}
                />
                
                <b>UPLOAD FRAME</b>
                <br/>
                <form className='form-box' onSubmit={this.handleSubmit}>
                    {/* <Select 
                      placeholder='Select Frame...' 
                      name='selectList' 
                      required 
                      id='selectList' 
                      onChange={this.categoryChange} 
                      options={this.props.categoryOptions}
                    />
                    <br/>

                    <Select placeholder='Select Bundle...' name='selectBundle' required id='selectBundle' onChange={this.bundleChange} options={this.bundlesdata.bundles}/> */}

                    <br/>
                    Coordinates
                    <br/>
                    X: 
                    <input type="text" value='' />
                    &nbsp;&nbsp;&nbsp;
                    Y: 
                    <input type="text" value='' />
                    <br/>
                    <br/>
                    H: 
                    <input type="text" value='' />
                    &nbsp;&nbsp;&nbsp;
                    W: 
                    <input type="text" value='' />
                    <br/>
                    <br/>
                    
                    <input type="file" required onChange={this.onImageChange} />
                    {/* <input type="file" multiple accept='image/*' onChange={this.onImagesChange} /> */}
                    <br/>
                    <input type="submit" value="Submit" />
                </form>
            </div>
        </div>
            
    ):"";
}

export default UploadLoveFramesData
